:35:50','2024-11-24 19:35:50'),(162,603,'','2024-11-24 19:35:50','2024-11-24 19:35:50'),(163,612,'','2024-11-24 19:35:50','2024-11-24 19:35:50'),(224,858,'cooperative: willing to help or do what people ask\r\n \r\nvisible: able to be seen\r\n \r\nessential: necessary or needed\r\n \r\nalternative: (of one or more things) available as another possibility\r\n \r\n=> \"essential\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 09:59:48'),(225,861,'yet: still; until the present time\r\n \r\njust: very recently\r\n \r\nfew: some, or a small number of something\r\n \r\nstill: continuing to happen or continuing to be done\r\n \r\n=> \"just\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:02:39'),(226,865,'fix: to repair something\r\n\r\nwrite: to put all the information that is needed on a document\r\n\r\nsend: to cause something to go from one place to another, especially by post or email\r\n\r\ndirect: to control or be in charge of an activity, organization\r\n\r\n=> \"write\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:03:38'),(227,870,'quote: the price that a person or company says they will charge to do a piece of work\r\n \r\ngraduation: the fact of finishing a degree or other course of study at a university or school, or the ceremony at which you are officially said to have finished\r\n \r\nrequest: the act of politely or officially asking for something\r\n \r\ndispute: an argument or disagreement, especially an official one between, for example, workers and employers or two countries with a common border\r\n \r\n=> \"request\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:03:38'),(228,876,'The blank is before a noun so an adjective/ noun is missing\r\n\r\n\"Legal\" is an adjective => a correct answer','2024-11-26 10:45:48','2024-12-01 10:04:33'),(229,881,'experience: (the process of getting) knowledge or skill from doing, seeing, or feeling things\r\n \r\ngrowth: an increase in the size or the importance of something\r\n \r\nformula: a standard or accepted way of doing or making something\r\n \r\nincentive: something that encourages a person to do something\r\n \r\n=> \"growth\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:10:16'),(230,873,'The blank is before a verb so that an adverb is missing. \nstrategy, strategies (n): a plan that is intended to achieve a particular purpose\r\n\r\nstrategically (adv): in a way that helps to achieve a plan, for example in business or politics\r\n\r\nstrategic (adj): helping to achieve a plan, for example in business or politics','2024-11-26 10:45:48','2024-12-01 10:08:36'),(231,884,'The blank is after \"tobe\" and before a past participle verb, so an adverb is missing. \n=> \"mechanically\" is a correct answer','2024-11-26 10:45:48','2024-12-01 10:10:16'),(232,898,'We have the structure noun of noun. \nThe blank is after an adjective and before \"of\" so a noun is missing.','2024-11-26 10:45:48','2024-12-01 10:13:12'),(233,889,'expressive: showing what someone thinks or feels\r\n \r\nreliable: deserving trust; dependable\r\n \r\npartial: not complete\r\n \r\nextreme: very large in amount or degree\r\n \r\n=> \"reliable\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:13:12'),(234,892,'After the transitive verb \"give\", an object (noun) is needed.','2024-11-26 10:45:48','2024-12-01 10:13:12'),(235,906,'We have the structure: article/possessive adjective + noun phrase\n\n\"his\" is a possessive adjective','2024-11-26 10:45:48','2024-12-01 10:13:12'),(236,903,'The missing position is after an adjective, we need to add a noun','2024-11-26 10:45:48','2024-12-01 10:13:12'),(237,910,'After \"tobe\" we use adjectives. \nIt is necessary (+ for sb) + to do sth\r\n\r\nTherefore, \"necessary\" is the correct answer\r\n\r\nnecessitate (v): to make something necessary\r\n\r\nnecessarily (adv): used to say that something cannot be avoided\r\n\r\nnecessary (adj): that is needed for a purpose or a reason\r\n\r\nnecessity (n): the need for something','2024-11-26 10:45:48','2024-12-01 10:13:12'),(238,912,'The missing position is in the relative clause, we need a relative pronoun to explain the subject, Mr. \nRoss','2024-11-26 10:45:48','2024-12-01 10:15:31'),(239,918,'rarely: not often\r\n \r\ntiredly: in a way that shows a need to rest or sleep\r\n \r\nopenly: without hiding any of your thoughts or feelings\r\n \r\nhighly: very, to a large degree, or at a high level\r\n \r\n=> \"openly\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:15:31'),(240,924,'notify: to tell someone officially about something\r\n \r\nagree: to have the same opinion\r\n \r\ngenerate: to cause something to exist\r\n \r\nperform: to do an action or piece of work\r\n \r\n=> \"Notify\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:15:31'),(241,921,'courteously: in a way that is polite and shows respect\n\ninitially: at the beginning\n\nperiodically: in a way that is repeated after a particular period of time\n\nphysically: in a way that relates to the body or someone\'s appearance\n\n=> \"periodically\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:18:45'),(242,928,'soon: in or within a short time; before long; quickly\n\nvery: to a great degree or extremely\n\nthat: used to refer to a person, object, idea, etc. that is separated from the speaker by space or time\n\nstill: continuing to happen or continuing to be done\n\n=> \"soon\" has the most appropriate meaning\n','2024-11-26 10:45:48','2024-12-01 10:35:14'),(243,935,'Structure: Avoid + V-ing + N\n=> \"Obstructing\" is a correct answer','2024-11-26 10:45:48','2024-12-01 10:35:14'),(244,940,'Anyone: any person or any people\n\nWhenever: every or any time\n\nOther: as well as the thing or person already mentioned\n\nFewer: some, or a small number of something\n\n=> \"Anyone\" has the most appropriate meaning\n','2024-11-26 10:45:48','2024-12-01 10:35:14'),(245,948,'Now that + clause = Because + clause','2024-11-26 10:45:48','2024-12-01 10:35:14'),(246,937,'In addition to: as well (as)\n\nThe fact that: used when talking about a situation and saying that it is true\n\nAs long as: if\n\nIn keeping with: in harmony or conformity with\n\n=> \"The fact that\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:35:14'),(247,944,'With the signal of \"for the next 3 months\", we need to use future simple tense. So \"will employ\" is the answer.','2024-11-26 10:45:48','2024-12-01 10:35:14'),(248,954,'Then: (at) that time (in the past or the future)\n\nSo that: to make something happen, make something possible\n\nBefore: at or during a time earlier than (the thing mentioned)\n\nWhereas: compared with the fact that; but\n\n=> \"Before\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:35:14'),(249,956,'In spite of + Noun = Although + clause: even though there is something unpleasant or bad happening\n\nEven if + Clause: used to say that if something is the case or not, the result is the same\n\nWhether + Clause: if, or not\n\nGiven that + Clause: seeing that','2024-11-26 10:45:48','2024-12-01 10:35:14'),(250,965,'\"at\" is used for specific places\n533 Bates Road is a specific place','2024-11-26 10:45:48','2024-12-01 10:35:14'),(251,960,'After: following in time, place, or order\n\nUntil: up to (the time that)\n\nBelow: in a lower position (than), under\n\nLike: similar to; in the same way or manner as\n\n=> \"After\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:35:14'),(252,971,'We have the structure \"be relevant to\" - to be connected with what is happening or being discussed','2024-11-26 10:45:48','2024-12-01 10:35:14'),(253,975,'proceed: to continue as planned\n\nperspective: a particular way of considering something\n\ninstallment: a sum of money due as one of several equal payments for something, spread over an agreed period of time\n\nstage: a part of an activity or a period of development\n\n=> \"Stage\" has the most appropriate meaning','2024-11-26 10:45:48','2024-12-01 10:35:14'),(254,977,'as well as ..... and strength => need a noun for word agreement.','2024-11-26 12:34:15','2024-12-01 16:05:57'),(255,982,'The subject is \"new appliances and equipment\" and the verb is \"bring\" => use passive form','2024-11-26 12:34:15','2024-12-01 16:09:03'),(256,986,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(257,990,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(258,994,'Based on the following sentence: \"Instead, the convenience shops will carry more sandwiches, prepared lunch boxes,and snacks for the employees during this time.\"','2024-11-26 12:34:15','2024-12-01 16:09:03'),(259,1000,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(260,1007,'Based on the previous sentence: \"Our products are known for their modern and unique patterns and color combinations...\" mentioning \"products\"','2024-11-26 12:34:15','2024-12-01 16:05:57'),(261,999,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(262,1010,'\"....a larger volume of meals can be provided (3) _____ the lunch and dinner rushes.\" => during is suitable','2024-11-26 12:34:15','2024-12-01 16:09:03'),(263,1013,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(264,1019,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(265,1020,'result in: to cause a particular situation to happen\noccur to: to come into your mind\nending at: to finish or stop, or to make something finish or stop\nstop with: to stop doing, using, or having something, especially something annoying or not wanted','2024-11-26 12:34:15','2024-12-01 16:05:57'),(266,1029,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(267,1025,'develop: to gradually grow or become bigger, more advanced, stronger, etc.; to make something do this\n\nimprove:  to make something/somebody better than before\n\nrectify: to put right something that is wrong\n\nrecover: to get well again after being ill, hurt, etc.','2024-11-26 12:34:15','2024-12-01 16:29:51'),(268,1033,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(269,1038,'ambitious: having a strong wish to be successful, powerful, or rich\ncombative: eager to fight or argue\naggressive: showing anger and a willingness to attack other people\ncomplacent: feeling so satisfied with your own abilities or situation that you feel you do not need to try any harder\n\nBased on the meaning of words => \"aggressive scrubbing\" is compatible to things mentioned such as \"harsh chemicals, steel sponges\"','2024-11-26 12:34:15','2024-12-01 16:05:57'),(273,1040,NULL,'2024-11-28 15:39:21','2024-11-28 15:39:21'),(274,1045,NULL,'2024-11-28 15:39:21','2024-11-28 15:39:21'),(275,1048,NULL,'2024-11-28 15:39:21','2024-11-28 15:39:21'),(276,1052,NULL,'2024-11-28 15:39:22','2024-11-28 15:39:22'),(277,1059,NULL,'2024-11-28 15:39:22','2024-11-28 15:39:22'),(278,1060,NULL,'2024-11-28 15:39:22','2024-11-28 15:39:22'),(279,1067,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(280,1071,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(281,1072,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(282,1078,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(283,1082,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(284,1087,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(285,1091,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(286,1094,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(287,1098,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(288,1100,NULL,'2024-12-01 11:26:55','2024-12-01 11:26:55'),(289,1106,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(290,1109,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(291,1113,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(292,1118,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(293,1121,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(294,1124,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56'),(295,1130,NULL,'2024-12-01 11:26:56','2024-12-01 11:26:56')