INSERT INTO `QuestionBundles` VALUES (15,36,'<p>Thank you for shopping at Larson’s China. Our products are known for their modern and unique patterns and color combinations, as well as (1) _____ and strength. (2) _____ Please note, however, that repeated drops and rough handling will (3) _____ eventual breakage. We suggest you store them carefully and that you don’t use harsh chemicals, steel sponges, or (4) _____ scrubbing when cleaning them. Please visit our <strong>website</strong> at www.larsonchina.com for information about handling and care or call us at 555-1234 if you have any questions or concerns.</p>',NULL,NULL,'2024-12-03 12:28:55','2024-11-26 12:34:15'),(16,36,'To:Kitchen staff,office employees\r\nFrom:Manager, LarryPark\r\nDate:March 23\r\nSubject: Renovations\r\n\r\nTo all kitchen staff and Harmon employees,\r\n\r\nFrom Sunday, March 23 to Thursday, March 27, the employee cafeteria kitchens will undergo renovations as new appliances and equipment (1) _____ in to replace the old ones. \n(2) _____ Instead, the convenience shops will carry more sandwiches, prepared lunch boxes,and snacks for the employees during this time. \nThe renovations will increase the number of sinks, ovens, and stove tops so that a larger volume of meals can be provided (3) _____ the lunch and dinner rushes. \nWe apologize for the inconvenience but we hope that the changes will (4) _____ the services in the cafeteria.',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(17,36,'Entry Position: Gold & Slide Accounting Firm\r\n\r\nWe are looking for enthusiastic candidates with an educational background in finance or (1) _____. \nAll candidates should have some computer experience. \nJob experience is not (2) _____ but preferred. \nCandidates with a bilingual language ability (3) _____ favored. \nPositions include jobs in accounting, statistics, and general office assistant. \nIf you are interested, please visit our website at www.G&Saccountingfirm.com/employment for more information. \nYou can send your cover letters and resumes to Karen Hill at khill@G&S.com. \nWe will begin interviewing candidates on Monday, November 5. \n(4) _____',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(18,36,'To: samsmith@digitallT.com\r\nFrom: sharronb@email.com\r\nDate: September 24\r\nSubject: Business Contract\r\n\r\nDear Mr. \nSmith,\r\nI am Sharron Biggs, CEO and founder of BiggsGraphics. \nI recently came across your advertisement (1) _____ partnership of a graphic design company for a number of your projects. \nBiggsGraphics has (2) _____ experience working with various small businesses and companies in designing advertising campaigns, logos, and websites. \n(3) _____ Our website www.biggs-graphics.com also has some information about our company. \nI’m interested in working with your company on your projects and hope we can build a beneficial partnership. \nI look forward (4) _____ your reply. \nSincerely, Sharron Biggs\r\nCEO, BiggsGraphics',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(19,38,'M: Joanne, did you hear that all employees will be receiving free tablet computers next week? \nQ1 I’m excited about it, but actually I don’t know how to use one. \nEven my mobile phone is not a smartphone. \nW: Don’t worry about it. \nI have one at home and they are very user-friendly. \nYou won’t have any trouble familiarizing yourself with it. \nM: I’m glad to hear that. \nQ2 As a logo design company, we can definitely use the tablet computers to increase work efficiency. \nW: You’re right. \nQ3 If you have any questions, feel free to ask me for help.',NULL,139,'2024-12-01 11:26:58','2024-12-01 11:26:55'),(20,38,'M: Hi, Linda. \nI’m responsible for putting together a slide show for Greg’s going-away party this Friday. \nQ1 However, I can’t find many pictures. \nDo you happen to have any photos of Greg that you could send to me? \nW: What? \nGreg is leaving the company? \nI had no idea. \nM: Yeah, he is taking a job at a design company. \nQ2 He said the job is more suited to his skills. \nW: Oh, I’m happy for him. \nI have a few photos from last year’s Christmas party. \nQ3 I’ll find the ones with Greg in them and e-mail them to you. \n',NULL,141,'2024-12-01 11:26:58','2024-12-01 11:26:55'),(21,38,'W: Q1 You beat me again! \nYou always get to work before I do even though I leave before you. \nHow do you do that? \nM: Which road do you take? \nW: Q2 I just follow my GPS and it shows that Kingsley Road is the most direct route to work. \nM: No, don’t follow your GPS. \nYour route passes through several residential areas and school zones as well as traffic signs, so it takes much longer to get here. \nW: Which route do you take then? \nM: Q3 I go to Cambridge street, which takes a bit of a detour from our apartments, but it’s practically a highway. \nI even have enough time to stop for some coffee before work. \nW: Wow, I always thought Cambridge would take much longer. \nM: No, it’s really quick. \nI can show you next time.',165,149,'2024-12-01 11:26:59','2024-12-01 11:26:55'),(22,38,'W: Q1 Chris, how are the renovations going in the dining room? \nDo you think we’ll be ready to reopen by this Saturday? \nM: No, definitely not. \nThe shipment of floor tiles still hasn’t arrived. \nQ2 Because the floor space is so large, it’ll take at least a week to finish the entire project. \nW: Ah, I see. \nWell, we have a lot of dinner reservations for the weekend. \nWhat should I do about that? \nM: Q3 Why don’t you call everyone who already made a reservation and offer them a 20% discount on their next meal by way of compensation? \n',NULL,144,'2024-12-01 11:26:58','2024-12-01 11:26:55'),(23,38,'W: Hi, Mr. \nJeffries. \nQ1 Unfortunately, our client in New Jersey called and said they have to reschedule the meeting date to 5th of July. \nI went ahead and booked a ticket for the 4th. \nIs it OK if you go straight to Washington after New Jersey? \nM: What about the client in Washington? \nWere they comfortable with the schedule? \nW: Yes. \nQ2 I explained that we need to postpone the meeting in Washington because of our client in New Jersey. \nI think this gives us time to prepare some additional materials for your presentation. \nI would like to add some more details to your PowerPoint slides about our new products. \nLet’s meet this afternoon and discuss it. \nM: Q3 That’s not a bad idea. \nI’ll see you this afternoon.',NULL,145,'2024-12-01 11:26:58','2024-12-01 11:26:56'),(24,38,'W: Q1 Have you placed the order yet? \nMr. \nJohnson just called and said he wants two more laptops, and a 50-inch monitor. \nM: Well, I already placed the previous order, Q2 but the laptops and monitor will have to wait until tomorrow. \nThe supply company closes at 8:00 P.M. \nW: Oh, will they be able to deliver to US on the same day? \nMr. \nJohnson was hoping to get everything tomorrow. \nM: I’m not sure. \nI\'ll call them first thing in the morning and find out. \nW: Meanwhile, how much was the total for the order? \nM: It came to $12,500. \nDo we have enough in our budget for more laptops and a monitor? \nW: Q3 I’ll call Mr. \nJohnson and ask. \nIt looks like we’ve gone over our budget. \n',NULL,146,'2024-12-01 11:26:58','2024-12-01 11:26:56'),(25,38,'M: Hello, I’m Steven from Home Appliance Mart. \nQ1 I’m here to install the UHD television that you ordered last week. \nW: Yes, come right this way. \nWe would like to mount the television on this wall. \nWe plan to use it for presentations and training seminars. \nM: Oh, no. \nQ2 It looks like I forgot the tools that I need to screw the television to the wall mount. \nI’m sorry. \nI’ll have to come back tomorrow morning. \nW: Oh, that’s all right. \nQ3 However, please call me before you come tomorrow to make sure that someone is in the office to meet you. \n',NULL,147,'2024-12-01 11:26:58','2024-12-01 11:26:56'),(26,38,'W: Hello, Mr. \nWeaver. \nQ1 You are one of the final applicants that we are considering for the teaching position at Belmont University. \nHow do you think your previous jobs have prepared you to teach at our university? \nM: Q2 Well, I used to be an editor-in-chief at a literary magazine. \nTherefore, I think it has prepared me well to teach in the English literature department at your university. \nI would be able to help students to become better writers. \nW: Well, I think you are right about that. \nYou seem to be qualified for the position. \nAs you may know, we don’t pay a lot for this position. \nQ3 However, if you take a job with US, you would receive a lot of time off during the summer vacation. \nM: Actually, that’s one of the reasons I chose this job.',NULL,148,'2024-12-01 11:26:58','2024-12-01 11:26:56'),(27,38,'W: Hi, we are renovating our boardroom and I’d like to purchase some cherry wood tables for our conference room. \nQ1 I am having a meeting with some very important clients on Friday. \nSo I’d like to have them delivered tomorrow. \nWhat is the cost for an emergency delivery? \nM: Hold a moment please... \nNext day delivery is an extra seventy-five dollars. \nW: Really? \nThat is expensive. \nI thought if my order was over three hundred dollars, delivery would be free of charge. \nM: Well, yes. \nQ2 Are you planning to order the cherry wood tables? \nW: Q2 Yes, I would like two of them. \nM: OK then, Q3 I will make sure that your order arrives tomorrow morning before midday, and delivery will be free of charge. \n',166,150,'2024-12-01 11:26:59','2024-12-01 11:26:57'),(28,38,'W: Hi, this is Rachel. \nQ1 I’m calling to see if I can upgrade from coach to business for my flight to Thailand this June. \nM: OK, can I have your membership number please? \nW: Yes, it’s EM3985771. \nM: Q3 I’m sorry. \nYou don’t have enough points for this trip. \nHowever, I see that you’re traveling to Korea and Japan next week. \nThat should give you enough points to upgrade in June. \nWhy don’t you call again after your trip? \nW: OK, that’s a great idea. \nI’ll call again in two weeks.',167,151,'2024-12-01 11:26:59','2024-12-01 11:26:57'),(29,38,'M1: Tom and Julie, I need the sales reports for this month ready a bit early. \nNext month is really important for our company so we need to prepare a bit earlier than usual. \nW: Sure. \nBut we will need to do some overtime. \nQ1 We are really busy at the moment so it’s going to be a lot of extra hours after work, and I have to take care of my children. \nM2: Yeah, that’s a lot of extra work. \nQ2 I think after next month we should get a few days added to our vacation. \nW: That sounds reasonable. \nQ3 I will need to hire a babysitter while I’m doing the overtime, so the extra vacation time seems fair. \nM1: I agree. \nOkay, we will discuss the details later, but I definitely agree with you. \n',NULL,140,'2024-12-01 11:26:58','2024-12-01 11:26:57'),(30,38,'M: Q1 Rachel, how was your vacation in Australia? \nW: It was fantastic. \nIt is a beautiful country, but we did not get to see everything we wanted to see. \nMaybe we will go back in the future. \nHave you managed to find a new account manager yet? \nWe are starting to get busy and we need some more staff. \nM: Actually, there is someone we are looking to hire. \nHis cv is quite impressive. \nHere, take a look. \nW: Q2 What’s this? \nIs this Robert Wilder’s application? \nI have known him for years! \nQ3 We play tennis together on the weekends. \nSo you are thinking about hiring him? \nM: Yeah. \nThe interview went really well and he has all the qualifications. \nI think he can be a great member of our team. \nW: I agree. \nI have never worked with him, but personally, I think he will be an excellent employee. \nQ1 I’m just surprised to see him applying here. \n',NULL,142,'2024-12-01 11:26:58','2024-12-01 11:26:57'),(31,38,'M: Excuse me. \nQ1 I’m conducting research on the effect that the new downtown mall is having on local residents’ shopping habits. \nDo you have a moment to talk to me? \nW: Sure, no problem. \nI can tell you that since the mall was built, I find myself coming downtown a lot more. \nQ2 I think what I like most is that I never have to struggle to find a parking spot. \nM: I see. \nWhat about the variety of shops? \nAre you satisfied with that? \nW: Q3 Well, I usually come to the mall to shop for clothes. \nI think there is a wide selection of women’s clothes. \n',NULL,143,'2024-12-01 11:26:58','2024-12-01 11:26:58');
