CREATE DEFINER=`root`@`%` PROCEDURE `GetVocabularyStatuses`(
	IN p_userId INT
)
BEGIN
	SELECT 
		v.id AS vocabularyId,
		v.topicId as topicId,
		COALESCE(p.status, 3) AS status
	FROM 
		Vocabularies v
	LEFT JOIN
		VocabularyPracticeStatuses p
	ON 
		v.id = p.vocabularyId AND p.userId = p_userId
	ORDER BY
		v.id;
END ;;
